import React, {useState} from 'react';

//Packages
import {Link} from 'react-router-dom';
import {SiAccusoft as NavLogo} from 'react-icons/si';
import {CgMenuMotion as MenuIcon} from 'react-icons/cg';
import {BsX as XIcon} from 'react-icons/bs';

//Components
import Button from './../button/Button';

//CSS
import './Nav.css';

function Nav() {
    const [navClick, setNavClick] = useState(false);
    const [button, setButton] = useState(true);

    const onHandleClick = () => setNavClick(!navClick);

    const closeMobileMenu = () => setNavClick(false);

    const showButton = () => {
        if (window.innerWidth <= 960) {
            setButton(false)
        } else {
            setButton(true);
        }
    };

    window.addEventListener('resize', showButton)

    return (
        <>
            <nav className="nav">
                <div className="nav__container">

                    <ol>
                        <li>
                            <Link to='/' className={'nav__logo'}>
                                TRVL <NavLogo size={25}/>
                            </Link>

                            <div className="menu__icon" onClick={onHandleClick}>
                                <i className={navClick ? <MenuIcon/> : <XIcon/>}/>
                            </div>
                        </li>
                    </ol>

                    <ul className={navClick ? 'nav__menu active' : 'nav__menu'}>
                        <li>
                            <Link to={'/'} className={'nav__links'} onClick={closeMobileMenu}>
                                Home
                            </Link>
                        </li>

                        <li>
                            <Link to={'/services'} className={'nav__links'} onClick={closeMobileMenu}>
                                Services
                            </Link>
                        </li>

                        <li>
                            <Link to={'/products'} className={'nav__links'} onClick={closeMobileMenu}>
                                Products
                            </Link>
                        </li>

                        <li>
                            <Link to={'/register'} className={'nav__links'} onClick={closeMobileMenu}>
                                Register
                            </Link>
                        </li>

                        {button && <Button buttonStyle={'btn--outline'}>SIGN UP</Button>}

                    </ul>

                </div>
            </nav>
        </>
    )
}

export default Nav;
